import React, { useState } from 'react';
import {
  Container,
  Typography,
  TextField,
  Grid,
  Button,
  IconButton,
  Box
} from '@mui/material';
import { AddCircle, RemoveCircle } from '@mui/icons-material';
import { useNavigate } from 'react-router-dom';

const CreateProjectPage = () => {
  const navigate = useNavigate();
  const [projectName, setProjectName] = useState('');
  const [tripType, setTripType] = useState('');
  const [startDate, setStartDate] = useState('');
  const [endDate, setEndDate] = useState('');
  const [groupMembers, setGroupMembers] = useState([{ name: '', email: '' }]);
  const [error, setError] = useState('');

  const handleMemberChange = (index, field, value) => {
    const updated = [...groupMembers];
    updated[index][field] = value;
    setGroupMembers(updated);
  };

  const addMember = () => {
    setGroupMembers([...groupMembers, { name: '', email: '' }]);
  };

  const removeMember = (index) => {
    if (groupMembers.length > 1) {
      const updated = [...groupMembers];
      updated.splice(index, 1);
      setGroupMembers(updated);
    }
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    const customer_id = localStorage.getItem('customer_id');

    if (!customer_id) {
      setError('User not logged in. Please login first.');
      return;
    }

    try {
      const response = await fetch('http://localhost:5000/create-trip', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json'
        },
        body: JSON.stringify({
          customer_id,
          project_name: projectName,
          start_date: startDate,
          end_date: endDate,
          trip_type: tripType,
          group_members: groupMembers
        })
      });

      const data = await response.json();
      if (response.ok) {
        alert('Project created successfully!');
        navigate('/dashboard');
      } else {
        setError(data.error || 'Failed to create project');
      }
    } catch (err) {
      console.error(err);
      setError('Server error while creating project.');
    }
  };

  return (
    <Container maxWidth="md" sx={{ mt: 4 }}>
      <Typography variant="h4" align="center" gutterBottom>
        Create New Project
      </Typography>

      {error && (
        <Typography color="error" align="center" gutterBottom>
          {error}
        </Typography>
      )}

      <form onSubmit={handleSubmit}>
        <TextField
          fullWidth
          label="Project Name"
          margin="normal"
          value={projectName}
          onChange={(e) => setProjectName(e.target.value)}
          required
        />

        <TextField
          fullWidth
          label="Trip Type"
          margin="normal"
          value={tripType}
          onChange={(e) => setTripType(e.target.value)}
          required
        />

        <Grid container spacing={2}>
          <Grid item xs={6}>
            <TextField
              type="date"
              fullWidth
              label="Start Date"
              margin="normal"
              InputLabelProps={{ shrink: true }}
              value={startDate}
              onChange={(e) => setStartDate(e.target.value)}
              required
            />
          </Grid>
          <Grid item xs={6}>
            <TextField
              type="date"
              fullWidth
              label="End Date"
              margin="normal"
              InputLabelProps={{ shrink: true }}
              value={endDate}
              onChange={(e) => setEndDate(e.target.value)}
              required
            />
          </Grid>
        </Grid>

        <Typography variant="h6" sx={{ mt: 3 }}>
          Group Members
        </Typography>

        {groupMembers.map((member, index) => (
          <Box key={index} display="flex" alignItems="center" gap={2} mt={1}>
            <TextField
              label="Name"
              value={member.name}
              onChange={(e) => handleMemberChange(index, 'name', e.target.value)}
              required
            />
            <TextField
              label="Email"
              value={member.email}
              onChange={(e) => handleMemberChange(index, 'email', e.target.value)}
              required
            />
            <IconButton
              onClick={() => removeMember(index)}
              disabled={groupMembers.length === 1}
            >
              <RemoveCircle color="error" />
            </IconButton>
          </Box>
        ))}

        <Button
          variant="outlined"
          startIcon={<AddCircle />}
          onClick={addMember}
          sx={{ mt: 2 }}
        >
          Add Group Member
        </Button>

        <Button
          type="submit"
          fullWidth
          variant="contained"
          color="primary"
          sx={{ mt: 4 }}
        >
          Save Project
        </Button>
      </form>
    </Container>
  );
};

export default CreateProjectPage;
